	 BufferIn = {};

	 BufferIn.dwStructSize = WrapperX.MemAlloc(64);//sizeof(INTERNET_BUFFERS);
     BufferIn.dwBufferTotal = BodySize; //DWORD(BodySize);   // +  m_lstrlen(SendBuf);

	 BufferIn.dwOffsetHigh = 0; 
