Помнишь, тебе реализацию структуры скидывал?
Просто так
       BufferIn.dwOffsetHigh = 0; 
       BufferIn.dwOffsetLow = 0; 
       BufferIn.dwBufferLength = 0; 
и т.д.
в winapi не передать. Нужно выделять буфер в непрерывном куске памяти с помощью MemAlloc
Вместо js > null в winapi нужно использовать 0

Понятно.

Вот смотри, работа со структурами winapi д.б (si & pi в CreateProcessA):

TStruct = function (Size)
{
  this.data = WrapperX.MemAlloc(Size, 1);
  this.Offsets = [];
  this.Size = Size;
  Sizes = '1bc2nt4luf8mqd0hpwszv';
  o = 0;
  for (i = 0; i < this.Types.length; i++) // init offsets
  {
    j = Sizes.indexOf(this.Types.charAt(i));
    if (j == -1) throw new Error('In TStruct: no such type.');
    this.Offsets[i] = o; // note: field offset cannot be greater than 255
    o += (j <= 2) ? 1 :
      (j <= 5) ? 2 :
        (j <= 9) ? 4 :
          (j <= 13) ? 8 :
            PSize;
  }

  /// as js has no explicit destructor so use this func
  this.Free = function ()
  {
    WrapperX.MemFree(this.data);
  }

  this.SetField = function (Name, Value)
  {
    // WScript.Echo(Name + " = " + Value + " at addr " + this.Fields[Name][0] + ' of type ' + this.Fields[Name][1]);
    // NumPut(Var, Address[, Offset][, Type]) — writes a number to memory.
    n = this.Fields[Name];
    WrapperX.NumPut(Value, this.data, this.Offsets[n], this.Types.charAt(n));//this.Types[this.Fields[Name]]);
  }

  this.GetField = function (Name)
  {
    n = this.Fields[Name];
    return WrapperX.NumGet(this.data, this.Offsets[n], this.Types.charAt(n));
  }
}

STARTUPINFOA = function ()
{
  this.Types = 'lsssllllllllttphhh';
  // define field that will be used in the prog
  this.Fields =
  {
    cb: 0,
    dwFlags: 11,
    wShowWindow: 12,
    hStdOutput: 16,
    hStdError: 17
  }
  // TStruct.call(this, 104);
  TStruct.call(this, WrapperX.Bitness() == 32 ? 104 : 104 + 4 * 4); //4*4 for phhh for x64
}

function CreateProc(CmdLine, StartupInfo, Suspended)
{
  si = new STARTUPINFOA();
  si.SetField('cb', si.Size);
  if (StartupInfo) si = StartupInfo;
  pi = new TProcInfo(new PROCESS_INFORMATION(), Suspended);
  CREATE_SUSPENDED = 0x00000004;
  if (!WrapperX.CreateProcessA(0, CmdLine, 0, 0, true, Suspended ? CREATE_SUSPENDED : 0,
    0, 0, si.data, pi.data))
    return null;
  pi.SetData();
  pi.Suspended = Suspended;
  return pi;
}
